import 'package:mobile_bro_food_admin_panel/model/Addres.dart';import 'package:mobile_bro_food_admin_panel/model/food_model.dart';class OrderModel { late  String numberPhone; late String token; late String comment; late  String typePay; late String deliveryTime; late List<Foods> foods; late List<Addres> addres;  OrderModel({      required this.numberPhone,      required this.token,    required   this.foods,    required  this.addres,    required    this.comment,    required   this.typePay,    required  this.deliveryTime,});  OrderModel.fromJson(dynamic json) {    numberPhone = json['numberPhone'];    token = json['token'];    comment = json['comment'];    typePay = json['typePay'];    deliveryTime = json['deliveryTime'];    json['foods'].map((item)=>foods.add(item));    json['addres'].map((item)=>addres.add(item));    addres = json['addres'];  }  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['numberPhone'] = numberPhone;    map['token'] = token;    map['foods'] = foods;    map['addres'] = addres;    map['comment'] = comment;    map['typePay'] = typePay;    map['deliveryTime'] = deliveryTime;    return map;  }}